import { USER_REQUEST ,USER_SUCCESS,USER_FAILURE,CREATE_USER,UPDATE_USER,DELETE_USER } from '../actions/types'

const initialState = {
    username: "",
    id:"",
    requested: null,
    errorMessage:""
}

export default (state = initialState, action)=> {
    switch (action.type) {
        case USER_REQUEST:
            return
            break;

        default:
            break;
    }
}
